// Desestructuracion
// Asignacion Desestructurante


const persona = {
    nombre: 'Tony',
    edad: 45,
    clave: 'Iroman',
    rango: 'Coronel'
}



const userContext = ({clave, edad, nombre, rango = 'Capitan'}) => {

    return {
        nombreClave: clave,
        anios: edad
    }
}

const avenger = userContext( persona );

const {nombreClave, anios} = avenger;

console.log(nombreClave, anios);
